import React, { useState } from "react";
import { Bar, Pie, Line } from "react-chartjs-2";
import Papa from "papaparse"; // For parsing CSV files
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  BarElement,
  Title,
  Tooltip,
  Legend,
  ArcElement,
  PointElement,
  LineElement,
} from "chart.js";

// Register Chart.js components
ChartJS.register(
  CategoryScale,
  LinearScale,
  BarElement,
  Title,
  Tooltip,
  Legend,
  ArcElement,
  PointElement,
  LineElement
);

const InferentialStatisticsVisualiser = () => {
  const [fileData, setFileData] = useState([]);
  const [chartType, setChartType] = useState("Bar");

  // Handle File Upload
  const handleFileUpload = (event) => {
    const file = event.target.files[0];
    if (file) {
      Papa.parse(file, {
        header: true,
        skipEmptyLines: true,
        complete: (result) => {
          setFileData(result.data);
        },
      });
    }
  };

  // Prepare Chart Data
  const prepareChartData = () => {
    if (fileData.length === 0) return null;

    const labels = Object.keys(fileData[0]);
    const dataValues = labels.map((label) =>
      fileData.reduce((sum, row) => sum + Number(row[label] || 0), 0)
    );

    return {
      labels,
      datasets: [
        {
          label: "Dataset",
          data: dataValues,
          backgroundColor: [
            "#FF6384",
            "#36A2EB",
            "#FFCE56",
            "#4BC0C0",
            "#9966FF",
            "#FF9F40",
          ],
        },
      ],
    };
  };

  // Render Chart
  const renderChart = () => {
    const chartData = prepareChartData();
    if (!chartData) return <p>Please upload a valid CSV file.</p>;

    if (chartType === "Bar") {
      return <Bar data={chartData} options={{ responsive: true }} />;
    }
    if (chartType === "Pie") {
      return <Pie data={chartData} options={{ responsive: true }} />;
    }
    if (chartType === "Line") {
      return <Line data={chartData} options={{ responsive: true }} />;
    }
    return null;
  };

  // Render Component
  return (
    <div style={styles.container}>
      <h1 style={styles.title}>Inferential Statistics Visualizer</h1>

      {/* File Upload */}
      <div style={styles.uploadContainer}>
        <label style={styles.label}>Upload CSV File:</label>
        <input
          type="file"
          accept=".csv"
          onChange={handleFileUpload}
          style={styles.fileInput}
        />
      </div>

      {/* Chart Type Selector */}
      <div style={styles.dropdownContainer}>
        <label htmlFor="chart-select" style={styles.label}>
          Select Chart Type:
        </label>
        <select
          id="chart-select"
          style={styles.select}
          value={chartType}
          onChange={(e) => setChartType(e.target.value)}
        >
          <option value="Bar">Bar Chart</option>
          <option value="Pie">Pie Chart</option>
          <option value="Line">Line Chart</option>
        </select>
      </div>

      {/* Chart Render */}
      <div style={styles.chartContainer}>{renderChart()}</div>
    </div>
  );
};

// Styles
const styles = {
  container: {
    fontFamily: "Arial, sans-serif",
    maxWidth: "800px",
    margin: "20px auto",
    padding: "20px",
    border: "1px solid #ccc",
    borderRadius: "12px",
    boxShadow: "0 4px 12px rgba(0, 0, 0, 0.15)",
    backgroundColor: "#f9f9f9",
  },
  title: {
    textAlign: "center",
    color: "#444",
    marginBottom: "20px",
  },
  uploadContainer: {
    textAlign: "center",
    marginBottom: "20px",
  },
  label: {
    fontSize: "16px",
    marginRight: "10px",
    color: "#333",
  },
  fileInput: {
    padding: "10px",
    fontSize: "16px",
  },
  dropdownContainer: {
    textAlign: "center",
    marginBottom: "20px",
  },
  select: {
    padding: "10px",
    fontSize: "16px",
    borderRadius: "8px",
    border: "1px solid #ccc",
    outline: "none",
    cursor: "pointer",
  },
  chartContainer: {
    marginTop: "20px",
    padding: "20px",
    backgroundColor: "#fff",
    borderRadius: "8px",
    boxShadow: "0 2px 8px rgba(0, 0, 0, 0.1)",
  },
};

export default InferentialStatisticsVisualiser;
